export const getAbdurahmanmesaad = () => {
    let abdelrahmanmosad = [];
    for (let i = 1; i <= 12; i++) {
        abdelrahmanmosad.push({
            id: `abdelrahmanmosad-${abdelrahmanmosadIds[i - 1]}`,
            surahNumber: i,
            quranReciter: 'عبد الرحمن مسعد',
            photo: 'data:image/webp;base64,',
            title: QURAN_SUWAR[Number(abdelrahmanmosadIds[i - 1]) - 1],
            url: `https://ia904706.us.archive.org/13/items/010_20221110/${abdelrahmanmosadIds[i]}.mp3`
        });
    }
    return abdelrahmanmosad;
};
